import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";

const View = () => {
  const [data, setData] = useState({});
  const getDataFun = async () => {
    try {
      axios
        .get("/getData")
        .then((res) => {
          setData(res.data);
          console.log(res.data);
        })
        .catch((err) => {
          console.log(err);
        });
    } catch (err) {
      console.log(err);
    }
  };

  useEffect(() => {
    getDataFun();
  }, []);

  return (
    <>
      <div className="">
        <h3 className="text-center mb-3"> Testimonials View </h3>
        <table className="table table-bordered">
          <thead>
            <th style={{ width: "80px" }}> S. No </th>
            <th style={{ width: "100px" }}> Profile </th>
            <th style={{ width: "120px" }}> Name </th>
            <th style={{ width: "120px" }}> Post </th>
            <th> Disc </th>
            <th style={{ width: "120px" }}> Created Date </th>
            <th style={{ width: "120px" }}> Updated Date </th>
            <th style={{ width: "50px" }}> Status </th>
          </thead>
          <tbody>
            {data.length > 0 && (
              <>
                {data.map((dbData) => (
                  <tr key={dbData.id}>
                    <td> 1 </td>
                    <td>
                      {/* {dbData.img} */}
                      <img
                        src={"upload/"}
                        alt=""
                        style={{ width: "100px", borderRadius: "50%" }}
                      />
                    </td>
                    <td> {dbData.name} </td>
                    <td> {dbData.post} </td>
                    <td> {dbData.disc} </td>
                    <td> {dbData.cDate} </td>
                    <td> {dbData.upDate} </td>
                    <td> {dbData.status} </td>
                  </tr>
                ))}
              </>
            )}
          </tbody>
        </table>
      </div>
    </>
  );
};

export default View;
